create table site_info_dailies
(
    id                    bigint unsigned auto_increment
        primary key,
    date                  date                                      not null comment '统计日期',
    mini_active_users     int             default 0                 not null comment '小程序活跃用户数',
    pc_active_users       int             default 0                 not null comment 'PC端活跃用户数',
    h5_active_users       int             default 0                 not null comment 'h5端活跃用户数',
    new_users             int             default 0                 not null comment '新增用户数',
    mini_threads          int             default 0                 not null comment '小程序发帖数',
    pc_threads            int             default 0                 not null comment 'pc发帖数',
    h5_threads            int             default 0                 not null comment 'h5发帖数',
    mini_posts            int             default 0                 not null comment '小程序回帖数',
    pc_posts              int             default 0                 not null comment 'pc回帖数',
    h5_posts              int             default 0                 not null comment 'h5回帖数',
    threads_sum           int             default 0                 not null comment '总发帖数',
    posts_sum             int             default 0                 not null comment '总回复数',
    start_count           int             default 0                 not null comment '启动数',
    pc_start_count        bigint unsigned default 0                 not null comment 'pc端启动数',
    h5_start_count        bigint unsigned default 0                 not null comment 'h5端启动数',
    mini_start_peoples    bigint unsigned default 0                 not null comment '小程序端启动人数',
    mini_start_count      bigint unsigned default 0                 not null comment '小程序端启动数',
    start_peoples         int             default 0                 not null comment '启动人数',
    pc_start_peoples      bigint unsigned default 0                 not null comment 'pc端启动人数',
    h5_start_peoples      bigint unsigned default 0                 not null comment 'h5端启动人数',
    orders_count          int             default 0                 not null comment '订单数',
    orders_money          decimal(12, 2)  default 0.00              not null comment '订单金额',
    withdrawal_profit     decimal(12, 2)  default 0.00              not null comment '提现收付费收入',
    order_royalty         decimal(12, 2)  default 0.00              not null comment '打赏提成收入',
    total_register_profit decimal(12, 2)  default 0.00              not null comment '注册加入收入',
    is_upload             tinyint         default 0                 not null,
    created_at            timestamp       default CURRENT_TIMESTAMP not null comment '创建时间',
    updated_at            timestamp       default CURRENT_TIMESTAMP not null on update CURRENT_TIMESTAMP comment '更新时间'
)
    collate = utf8mb4_unicode_ci
    auto_increment = 179;

